import '../../src/Style/about.css';


const About = ()=>{
    
    const ImageStyles = {
        width:"100%",
        height:"380px",
        marginTop:"40px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./aboutus_promo3.jpg')`,
        color:"white",
        fontSize:"50px",
        paddingTop:"165px",
        
    };

    return(

        <div> 
            <div style={ImageStyles}>
                We're just the bank you need.
            </div>
        </div>
        
    );

};

export default About;
